/**
 * **retain**(obj,...keys)
 *
 * Reduces the key/value pairs in an object to those keys
 * explicitly stated.
 *
 * **Related:** `createRetainer`, `omit`
 */
export const retain = (dict, ...keys) => {
    let output = {};
    for (const k of keys) {
        output = {
            ...output,
            [k]: dict[k]
        };
    }
    return output;
};
